import React from 'react';


const Tab = () => {
 return (
 <div style={{
   display:"flex",
   justfyContent: "space-evenly",
   width:"100vw",
   height:"70px",
   background:"black",
   position:"absolute",
   bottom:"0",
   color:"red"

 }}
 >
     <h1>Bitcoin</h1>
     <h1>Etherium</h1>
     <h1>Cardano</h1>
     
 </div>  
 );  
};

export default Tab;
